import axios from 'axios';

const baseUrl = 'https://localhost:7191';

export async function getProfessionals(){
    try{
        const response = await axios({
            url: `${baseUrl}/professional/list`,
            method: 'GET',
        })
        return response
    }catch (errors) {
        console.log(errors)
    }
}
